css:
.regex-railroad-diagram {
  background: #fff;
  overflow-x: scroll;
  display: block;
}
.regex-railroad-diagram .settings-view {
  display: flex;
  padding: 5px;
}
.regex-railroad-diagram .settings-view > div {
  padding: 5px 5px;
}
.regex-railroad-diagram .settings-view .texteditor-container {
  flex: 100 1;
}
.regex-railroad-diagram .settings-view .option-buttons {
  flex: 1;
  flex-wrap: nowrap;
  display: flex;
  font-weight: bold;
}
.regex-railroad-diagram .error-message {
  color: #fa5252;
}
.regex-railroad-diagram svg.railroad-diagram {
  stroke: #212529;
  fill: #212529;
  max-width: 100%;
  max-height: 50vh;
}
.regex-railroad-diagram svg.railroad-diagram path {
  stroke-width: 2;
  fill: rgba(0, 0, 0, 0);
}
.regex-railroad-diagram svg.railroad-diagram text {
  font-size: 12px;
  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", "Roboto", "Oxygen", "Ubuntu", "Cantarell", "Fira Sans", "Droid Sans", "Helvetica Neue", sans-serif;
  stroke-width: 0;
  fill: #212529;
  text-anchor: middle;
}
.regex-railroad-diagram svg.railroad-diagram rect {
  stroke-width: 3;
  stroke: #212529;
  fill: #ffffff;
}
.regex-railroad-diagram svg.railroad-diagram g.literal > rect {
  stroke: rgba(120, 210, 120, 0.7);
  fill: rgba(80, 120, 80, 0.5);
}
.regex-railroad-diagram svg.railroad-diagram g.literal > text {
  fill: #b4dcb4;
}
.regex-railroad-diagram svg.railroad-diagram g.character-class > rect {
  stroke: rgba(210, 210, 120, 0.7);
  fill: rgba(120, 120, 80, 0.5);
}
.regex-railroad-diagram svg.railroad-diagram g.character-class > text {
  fill: #dcdcb4;
}
.regex-railroad-diagram svg.railroad-diagram g.character-class.invert > rect {
  stroke: rgba(210, 120, 120, 0.7);
  fill: rgba(120, 80, 80, 0.5);
}
.regex-railroad-diagram svg.railroad-diagram g.character-class.invert > text {
  fill: #dcb4b4;
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion > rect {
  stroke: rgba(210, 120, 210, 0.7);
  fill: rgba(120, 80, 120, 0.5);
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion > text {
  fill: #dcb4dc;
}
.regex-railroad-diagram svg.railroad-diagram g.group > rect {
  stroke-width: 1;
  fill: rgba(0, 0, 0, 0);
}
.regex-railroad-diagram svg.railroad-diagram g.group.capture-group > rect {
  stroke: rgba(120, 120, 210, 0.7);
  fill: rgba(80, 80, 120, 0.1);
}
.regex-railroad-diagram svg.railroad-diagram g.group.capture-group g.caption text {
  fill: #b4b4dc;
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion.group > rect {
  stroke-width: 2;
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion.positive > rect {
  stroke: rgba(120, 210, 120, 0.7);
  fill: rgba(120, 80, 120, 0.1);
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion.positive g.caption text {
  fill: #b4dcb4;
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion.negative > rect {
  stroke: rgba(210, 120, 120, 0.7);
  fill: rgba(120, 80, 120, 0.1);
}
.regex-railroad-diagram svg.railroad-diagram g.zero-width-assertion.negative g.caption text {
  fill: #dcb4b4;
}
.regex-railroad-diagram svg.railroad-diagram g.back-reference > rect {
  stroke: rgba(120, 120, 210, 0.7);
  fill: rgba(80, 80, 120, 0.1);
}
.regex-railroad-diagram svg.railroad-diagram g.back-reference > text {
  fill: #b4b4dc;
}
.regex-railroad-diagram svg.railroad-diagram g.quantified.lazy text {
  fill: #96c8c8;
}
.regex-railroad-diagram svg.railroad-diagram g.quantified.greedy text {
  fill: #c896c8;
}
